message:
🚨 Tenha cuidado este ano 🚨

É preciso ficar atento para impedir que mais traidores como Soraya e Peppa Pig sejam eleitos.

Pesquise sobre o seu candidato.

Veja se ele/ela é 

- a favor do armamento civil;
- contra o aborto;
- contra a legalização das drogas; 
- contra a ideologia de gênero;
- a favor da liberdade da econômica; 
- a favor da desburocratização; 
- a favor do patriotismo;
- contra o comunismo/socialismo.
- a favor do agro;
- a favor das polícias.
- contra o mst;
- contra a vacinação obrigatória;
- contra o passaporte do apartheid;
- contra o bandido;
- a favor da vítima;
- etc.

Entre nas redes sociais do seu candidato e veja se ele/ela apoia Bolsonaro.

Como ele/ela se posicion(a/ou) nas redes sociais desde 2019 até hoje (porque há candidatos espertalhões que mudaram da água para o vinho em 2021/2022) só para receber votos da direita.

Deus, Pátria, Família e Liberdade.

Hoje tem sabatina do Presidente Bolsonaro na TV Record.
A partir de 19:45, não perca!
@jairbolsonarobrasil #BrasilVota22

